class Solution {
    func findMinimumOperations(_ s1: String, _ s2: String, _ s3: String) -> Int {
        // Convert strings to arrays for easier character access
        let arr1 = Array(s1), arr2 = Array(s2), arr3 = Array(s3)
        // Calculate the minimum length among the three strings
        let minLength = min(arr1.count, arr2.count, arr3.count)
        var operations = 0

        // Check from the end of the strings to find the first mismatching position
        var mismatchFound = false
        for i in stride(from: minLength, through: 1, by: -1) {
            if arr1[arr1.count - i] == arr2[arr2.count - i] && arr2[arr2.count - i] == arr3[arr3.count - i] {
                // If all characters match up to this point, no mismatch found
                mismatchFound = false
            } else {
                // Mismatch found, need to remove characters
                mismatchFound = true
                break
            }
        }

        if !mismatchFound {
            // If there was no mismatch, calculate total operations needed to make strings equal
            operations = (arr1.count - minLength) + (arr2.count - minLength) + (arr3.count - minLength)
        } else {
            // If a mismatch is found, it's not possible to make strings equal by removing characters
            return -1
        }

        return operations
    }
}
